Tagline: Former cop Brian O'Conner partners with ex-con Dom Toretto on the opposite side of the law.
Since Brian and Mia Toretto broke Dom out of custody, they've blown across many borders to
elude authorities. Now backed into a corner in Rio de Janeiro, they must pull one last job
in order to gain their freedom. As they assemble their elite team of top racers, the unlikely
